function currentStyleIs(val) {
	var tmp = graph.getCellStyle(graph.getSelectionCell())[mxConstants.STYLE_FONTSTYLE];
	for (var i = 3; i >= 1; i--) {

		tmp = tmp - val * (Math.pow(2, i));
		if (tmp < 0) {
			tmp = tmp + val * Math.pow(2, i);
		}
	}
	return (tmp >= val);
}

