function parentAgent(cell) {
	if ((!cell) || cell == null) {
		return undefined;
	}

	var p = getParent(cell);
	if (p) {
		//console.log(p);
		if (p.getAttribute("Type") == "Agent") {
			return p;
		}
	}
	return parentAgent(p);
}

function isGray(color) {
	if (isUndefined(color)) {
		return true;
	}
	var c;
	if (color[0] == "#") {
		c = color;
	} else {
		c = colourNameToHex(color);
	}
	if (c == "#6482B9") {
		return true; //treat flows as grey alwayse
	}
	var start = c[1];
	if (c.length == 4) {
		for (var i = 2; i < c.length; i++) {
			if (c[i] != start) {
				return false;
			}
		}
	} else if (c.length == 7) {
		for (var i = 1; i < c.length; i = i + 2) {
			if (c[i] != start) {
				return false;
			}
		}
		var start = c[2];
		for (var i = 2; i < c.length; i = i + 2) {
			if (c[i] != start) {
				return false;
			}
		}
	}
	return true;
}

