function flatten(arr) {
	var r = [];

	function recFlatten(a) {
		var i, ln, v;

		for (i = 0, ln = a.length; i < ln; i++) {
			v = a[i];

			if (Array.isArray(v)) {
				recFlatten(v);
			} else {
				r.push(v);
			}
		}

		return r;
	}

	return recFlatten(arr);
}

