defineFunction("Min", {params:{name: "Items..."}, prep: joinVector}, function(x){
	var res = x.stackApply(function(v){
		var x = v.items;
		if(x.length > 0){
			var min = x[0];
			for (var i=1; i < x.length; i++) {
				if(lessThan(x[i], min)){
					min = x[i];
				}
			}
			return min;

		}else{
			throw "MSG: You must have at least one element to calculate a median.";
		}
	});
	
	return res;
});
