function getLinkedPrimitives(primitive) {
	let result=[];
	let allLinks = primitives("Link");
	for(let link of allLinks) {
		if(link.target == primitive) {
			if(link.source != null) {
				result.push(link.source);
			}
		}
	}
	return result;
}

