class SubscribePool {
	constructor() {
		this.subscribers=[];
	}
	subscribe(handler) {
		this.subscribers.push(handler);
	}
	publish(message) {
		for(var i in this.subscribers) {
			this.subscribers[i](message);
		}	
	}
}

